import React from 'react';	

const initialState = {vehicle: ''}
function reducer(state = initialState, action){

switch (action.type) {
    case "Car":
    return {
      vehicle: "It is a Car"
    };
    case "Bike":
    return {
      vehicle: "It is a Bike"
    };
    default:
      return "No";
  }
}

export default reducer;
